INSERT INTO `email_template` (`id`, `emai_template_name`, `email_status`, `email_slug`, `email_content`, `email_subject`, `email_available_tags`) VALUES
(1, 'Appointment details at {{app_name}}', 'active', 'appointment_email_template', '<center><br />\r\n<table id=\"bodyTable\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td id=\"bodyCell\" align=\"center\" valign=\"top\"><!-- BEGIN TEMPLATE // -->\r\n<table id=\"templateContainer\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"background-color: #314456; width: 600px;\" align=\"left\" valign=\"top\" height=\"20\"><center><br /><img style=\"display: block; width: auto; height: 120px;\" src=\"https://sac.eternity.online/pics/logo.jpg\" alt=\"SAC Eternity\" /></center></td>\r\n</tr>\r\n<tr>\r\n<td><img src=\"https://sac.eternity.online/pics/email.png\" alt=\"SAC Eternity\" align=\"center\" /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" valign=\"top\"><!-- BEGIN\r\nBODY // -->\r\n<table id=\"templateBody\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"bodyContainer\" valign=\"top\">\r\n<table class=\"mcnTextBlock\" style=\"background-color: #ffffff !important;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"padding-top: 9px; padding-right: 18px;\" valign=\"top\">\r\n<h3 style=\"text-align: left; font-family: Arial,sans-serif; font-size: 20px; color: #cc9800;\"><strong>Hola {{user_name}}</strong></h3>\r\n<p style=\"color: black;\">Se ha solicitado una nueva atenci&oacute;n <strong>{{app_no}}</strong>&nbsp;en el puesto <strong>\"{{app_position}}\"</strong> de <strong>\"{{app_department}}\"</strong>. <br /><br /></p>\r\n<hr />\r\n<p style=\"color: black;\"><strong>Tipo de atenci&oacute;n :</strong> {{app_type}}<br /><br /><strong><span class=\"Y2IQFc\" lang=\"es\">&iquest;Es la cita inminente?</span> :</strong> {{app_immediate}}<br /><br /><strong>Email:</strong> {{app_user_email}}</p>\r\n<p style=\"color: black;\"><strong>Tel&eacute;fono:</strong> {{app_user_phone}}</p>\r\n<p style=\"color: black;\"><strong>Asunto:</strong> {{app_subject}}</p>\r\n<hr />\r\n<p style=\"color: black;\"><strong>Nombramiento no de solicitud: </strong>{{app_no}}<strong><br /></strong><strong><br />Fecha de solicitud:</strong> {{app_start_date}}</p>\r\n<p style=\"color: black;\"><strong>Fecha de Inicio:</strong> {{app_start_date}}<br />recuerde ser puntual, si sobrepasa los 5 minutos de cortesia su cita ser&aacute; cancelada.</p>\r\n<p style=\"color: black;\"><strong>Fecha de Fin:</strong> {{app_end_date}}<br /><br /><strong>Acceder a la videoconferencia: </strong>{{app_url}}</p>\r\n<hr />\r\n<p style=\"color: black;\"><strong>Datos para ser atendido</strong></p>\r\n<p style=\"text-align: justify; font-size: 9px;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"{{app_url}}\"><button id=\"url-panel-completo\" style=\"cursor: pointer; display: inline-block; padding: 6px 12px; font-size: 14px; font-weight: normal; line-height: 1.42; text-align: center; white-space: nowrap; vertical-align: middle; border: 1px solid transparent; border-radius: 4px; color: #fff; background-color: #428bca; border-color: #357ebd; margin-right: 50px;\">Acceder a la videoconferencia</button></a><br /><br /></p>\r\n<p style=\"text-align: center;\"><a href=\"https://sac.eternity.online\">SAC Eternity</a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- // END BODY --></td>\r\n</tr>\r\n<tr style=\"background-color: #314456 !important; color: white !important;\" bgcolor=\"#314456\">\r\n<td align=\"center\" valign=\"top\"><!-- BEGIN\r\nFOOTER // --></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- // END TEMPLATE --></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</center>', 'This is the appointment email {{app_name}}', '');
